import { Icon } from "semantic-ui-react";

const OPEN_SIZE = "80%";
const CLOSED_SIZE = "0%";

type UserSideNavProps = {
    isUserOpen: boolean;
    handleClickUserClose: () => void;
}

const UserSideNav: React.FC<UserSideNavProps> = (props) => {
    const {isUserOpen, handleClickUserClose} = props;

    return (
        <div 
            className="sidenav siden" 
            style={{
                width: isUserOpen ? OPEN_SIZE : CLOSED_SIZE,
            }}
        >
            <h1 className="sidenav-title">Account</h1>
            <Icon
                name='close' 
                size='big'
                link
                inverted
                className='closebtn'
                onClick={handleClickUserClose}
            />
        </div>
    )
};

export default UserSideNav
